import './App.css';
import Login from './components/Login/Login'

function App() {
  return (
    <div >
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <NavBar/>
              <ProductList />


            </div>
          }
        />

        <Route path="/login" element={<Login/>} />
        //<Route path="/register" element={<SignUp/>} />
      </Routes> 

    </div>
  );
}

export default App;
